void strSortBetter(char str[]){
    /*
    // This is O(2n + 256)
    // First it hashes string by ascii values. This is O(n)
    // Next it goes through the hashed list of size 256 array which holds at each index the amount of characters sharing this ascii character value.
    // This should be O(2n + 256) though the 256 is not really needed since its a no matter what n you have you will need 256.
    // So the actual big-O is O(2n) as every n added needs 2 more iterations to happen to succeed.
    // Since Space Complexity doesn't Matter then this is fine
    // I was inspired by the python dictionaries which is considered one of the best hash maps out there.
    // This is obviously terrible compared to the python dictionary but it does its job phenomenally.
    */
    int asciiArray[256] = {0};
    for (int i = 0; str[i] != '\0'; i++){
        asciiArray[str[i]] += 1;
    }
    int c = 0;
    for (int i = 0; i < 256; i++){
        for (int j = 0; j < asciiArray[i]; j++){
            str[c] = i;
            c++;
        }
    }
}


char *smallerThan(char *x, char *y){
    // Its nicer to have this separated like this
    if (*x < *y)return x; else return y;
}


void idkSwaps(char *x, char *y){
    char temp = *x;
    *x = *y;
    *y = temp;
}


void str_sort(char str[]){
    // I could convert to ints but I don't wanna.
    // Also that can't expand very well
    // Not Going to work
    char *pointer;
    for (int i = 0; str[i+1] != '\0'; i++) {
        pointer = select_min(str, i);
        idkSwaps(&str[i], pointer);
    }
}


char *select_min(char str[], int num){
    char *pointToSmallestCharacter = &str[num];
    for (int i = num+1; str[i] != '\0'; i++){ // starts at 1 because index 0 starts off being the smallest
        pointToSmallestCharacter = smallerThan(pointToSmallestCharacter, &str[i]);
    }
    return pointToSmallestCharacter;
}
